    function showDate() {

            var d = myDay.getDate(); //取日期 1~31
            var w = myDay.getDay(); //取星期 0~6
            var m = myDay.getMonth() + 1; //取月份 0~11
            //var y = myDay.getFullYear() - 1911; //取西元年
            var y = myDay.getFullYear() ; //取西元年

            //return y + "年" + m + "月" + d + "日星期" + weelday[w];

            nowData.innerHTML = "" + y + "/" + m + "/" + d ;
        }

        function showTime() {
            var myDay = new Date();

            var h = myDay.getHours(); //取日期 1~31
            var mm = myDay.getMinutes(); //取星期 0~6
            var s = myDay.getSeconds(); //取月份 0~11

            nowTime.innerHTML = "" + h + ":" + mm + ":" + s;
            
            setTimeout("showTime();", 1000);
        }
